      /* (410) metaCall_args ::= metaCall_arg_list */ yytestcase(yyruleno==410);
      /* (411) metaCall_args ::= metaCall_args metaCall_args_next_group metaCall_arg_list */ yytestcase(yyruleno==411);
      /* (412) call_args_optional ::= open_parenthesis_or_space CLOSE_PARENTHESIS */ yytestcase(yyruleno==412);
      /* (413) call_args_optional ::= call_args */ yytestcase(yyruleno==413);
      /* (414) call_arg_list ::= call_arg (OPTIMIZED OUT) */ assert(yyruleno!=414);
      /* (415) call_arg_list ::= call_arg_list COMMA_SPACE call_arg */ yytestcase(yyruleno==415);
      /* (416) call_args ::= open_parenthesis_or_space call_arg_list close_parenthesis_or_comma */ yytestcase(yyruleno==416);
      /* (417) call_args ::= call_args call_args_next_group call_arg_list close_parenthesis_or_comma */ yytestcase(yyruleno==417);
      /* (418) call_args ::= call_args call_args_next_group CLOSE_PARENTHESIS */ yytestcase(yyruleno==418);
      /* (419) stmt ::= stmt_loop (OPTIMIZED OUT) */ assert(yyruleno!=419);
      /* (420) loop_continue_stmts ::= stmts_brace */ yytestcase(yyruleno==420);
      /* (421) loop_continue_stmts ::= stmts_expr SEMICOLON */ yytestcase(yyruleno==421);
      /* (422) loop_continue_stmts ::= stmts_expr */ yytestcase(yyruleno==422);
      /* (423) loop_expr2 ::= loop_forever (OPTIMIZED OUT) */ assert(yyruleno!=423);
      /* (424) stmt_if_chain ::= stmt_if (OPTIMIZED OUT) */ assert(yyruleno!=424);
      /* (425) stmt_if_chain ::= stmt_if_chain stmt_elif */ yytestcase(yyruleno==425);
      /* (426) stmt ::= stmt_switch (OPTIMIZED OUT) */ assert(yyruleno!=426);
      /* (427) switch_case_exprs ::= switch_case_expr (OPTIMIZED OUT) */ assert(yyruleno!=427);
      /* (428) switch_case_exprs ::= switch_case_exprs COMMA_SPACE switch_case_expr */ yytestcase(yyruleno==428);
      /* (429) switch_case_paren_or_expr ::= switch_case_exprs */ yytestcase(yyruleno==429);
      /* (430) switch_cases ::= switch_case (OPTIMIZED OUT) */ assert(yyruleno!=430);
      /* (431) switch_cases ::= switch_cases SPACE switch_case */ yytestcase(yyruleno==431);
      /* (432) stmt_expr ::= stmt_continue (OPTIMIZED OUT) */ assert(yyruleno!=432);
      /* (433) stmt_expr ::= stmt_break (OPTIMIZED OUT) */ assert(yyruleno!=433);
